import React, { useState, useEffect } from "react";
import { Link, NavLink, useNavigate } from "react-router-dom"; // Import useNavigate for navigation to other pages
import "../../styles/navbar.css";

function Navbar() {
  const [navActive, setNavActive] = useState(false);
  const navigate = useNavigate(); // Use useNavigate for navigation

  const toggleNav = () => {
    setNavActive(!navActive);
  };

  const closeMenu = () => {
    setNavActive(false);
  };

  return (
    <nav className={`navbar ${navActive ? "active" : ""}`}>
      <div>
        <img src="./img/logo.svg" alt="Ajay Kumar" />
      </div>
      <a
        className={`nav__hamburger ${navActive ? "active" : ""}`}
        onClick={toggleNav}
      >
        <span className="nav__hamburger__line"></span>
        <span className="nav__hamburger__line"></span>
        <span className="nav__hamburger__line"></span>
      </a>
      <div className={`navbar-items ${navActive ? "active" : ""}`}>
        <ul>
          {/* Links for scrolling within the page */}
          <li>
            <Link
              onClick={closeMenu}
              spy={true}
              smooth={true}
              offset={-70}
              duration={500}
              to="heroSection"
              className="navbar-content"
            >
              Home
            </Link>
          </li>
          {/* Other navigation links */}
          <li>
            <NavLink
              onClick={closeMenu}
              to="/portfolio"
              className="navbar-content"
            >
              Portfolio
            </NavLink>
          </li>
          <li>
            <NavLink
              onClick={closeMenu}
              to="/about"
              className="navbar-content"
            >
              About Me
            </NavLink>
          </li>
          <li>
            <NavLink
              onClick={closeMenu}
              to="/testimonials"
              className="navbar-content"
            >
              Testimonials
            </NavLink>
          </li>
          <li>
            {/* NavLink for navigation to a different page */}
            <NavLink to="/resume" className="navbar-content" onClick={closeMenu}>
              Resume
            </NavLink>
          </li>
        </ul>
      </div>
      {/* Link for scrolling within the page */}
      <Link
        onClick={closeMenu}
        spy={true}
        smooth={true}
        offset={-70}
        duration={500}
        to="contact"
        className="btn btn-outline-primary"
      >
        Contact Me
      </Link>
    </nav>
  );
}

export default Navbar;
